import axios from "axios";
// require("dotenv").config(); add?

const baseURL = process.env.REACT_APP_BASE_URL = 'http://localhost:8080'; // works with link, not in env

export const fetchTrafficUpdatesData = async (latitude: number, longitude:number) => {
  try {
    console.log(`Requesting: ${baseURL}/traffic-situations?latitude=${latitude}&longitude=${longitude}`);
    console.log("Sending request from apiService:", latitude, longitude);
    const response = await axios.get(
      `${baseURL}/traffic-situations?latitude=${latitude}&longitude=${longitude}`

    );
    return response.data;
  } catch (error) {
    console.error("Error fetching traffic data:", error);
    throw error;
  }
};
